    def splitPermutations(self, perm):
        list = perm.split(")(")
        
        return list
    
    def removeParanthesis(self, perms):
        i = 0
        while ( i < len(perms)):
            perms[i] = perms[i].replace("(", "")
            perms[i] = perms[i].replace(")", "")
            perms[i] = perms[i].split(" ")
            i += 1
        return perms
    
    def toDirectedInts(self, perms):
        directedPerm = []
        
        for perm in perms:
            lilPerm = []
            for p in perm:
                x = int(p)
                lilPerm.append(-x)
                lilPerm.append(x)
            lilPerm = lilPerm[1:] + lilPerm[0:1]
            directedPerm.append(lilPerm)
                    
        return directedPerm
        
        
    def toGraph(self, perms):
        graph = []
        
        for perm in perms:
            i = 0
            while ( i < len(perm) ):
                graph.append((perm[i], perm[i+1]))
                i += 2
        return graph
    

    def merge(self, p, q):
        merge = p + q
        return merge
    
    
    def reverseNode(self, node):
        return (node[1], node[0])
    
        
    def findNumCycles(self, graph):
        cy = 0
        i = 0
        
        while ( len(graph) != 0 ):
            
            cycle = []
            node = graph[i]
            
            cycle.append(node)
            graph.remove(node)
                
            while( len(graph) != 0):
                #print "cycle", cycle
                #print "graph", graph
                #print len(graph)
                
                front = [x[0] for x in graph]
                back = [x[1] for x in graph]
                
                #print front
                #print back
                
                f = node[1] in front
                b = node[1] in back
                
                #print f, b
                
                if ( not f and not b ):
                    cycle = []
                    node = graph[0]
                    cycle.append(node)
                    graph.remove(node)
                    cy += 1
                    continue
                
                if ( f ):
                    x = front.index(node[1])
                    node = graph[x]
                    cycle.append(node)
                    graph.pop(x)
                    continue
                if ( b ):
                    x = back.index(node[1])
                    node = self.reverseNode(graph[x])
                    cycle.append(graph[x])
                    graph.pop(x)
                    continue
        cy += 1
        return cy        
    
    

    def run(self):
        pList = self.splitPermutations(self.permutationP)
        qList = self.splitPermutations(self.permutationQ)
        
        pList = self.removeParanthesis(pList)
        qList = self.removeParanthesis(qList)
        
        #print pList
        #print qList
        
        pList = self.toDirectedInts(pList)
        qList = self.toDirectedInts(qList)
        
        #print pList
        #print qList
        
        
        pGraph = self.toGraph(pList)
        qGraph = self.toGraph(qList)
        
